ange`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"455179","type":"CustomJS"},{"attributes":{"bottom_units":"screen","coordinates":null,"fill_alpha":0.5,"fill_color":"lightgrey","group":null,"left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","syncable":false,"top_units":"screen"},"id":"454912","type":"BoxAnnotation"},{"attributes":{},"id":"455312","type":"StringFormatter"},{"attributes":{"bounds":[-298.85,6275.85],"end":5977,"js_property_callbacks":{"change:end":[{"id":"455179"}]},"min_interval":10},"id":"454848","type":"Range1d"},{"attributes":{},"id":"455314","type":"StringFormatter"},{"attributes":{},"id":"455108","type":"SaveTool"},{"attributes":{"coordinates":null,"group":null},"id":"455210","type":"Title"},{"attributes":{"callback":null,"formatters":{"@datetime":"datetime"},"mode":"vline","point_policy":"follow_mouse","renderers":[{"id":"455153"}],"tooltips":[["Date","@datetime{%c}"],["x, y","$index\u00a0\u00a0\u00a0\u00a0$y{0,0.0[0000]}"],["OHLC","@Open{0,0.0[0000]}\u00a0\u00a0\u00a0\u00a0@High{0,0.0[0000]}\u00a0\u00a0\u00a0\u00a0@Low{0,0.0[0000]}\u00a0\u00a0\u00a0\u00a0@Close{0,0.0[0000]}"],["Volume","@Volume{0,0}"]]},"id":"455177","type":"HoverTool"},{"attributes":{"axis":{"id":"454901"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"454904","type":"Grid"},{"attributes":{},"id":"455310","type":"StringForm
